import React from "react";
import Header from "../header/Header";
import "./home.css";

export default function Home() {
  return (
    <div
      className="Home"
      style={{
        backgroundImage:
          "url(" + "https://tsks.app/img/signin_balls.png" + ")",
      }}
    >
      <Header />

      <div className="content"></div>
    </div>
  );
}
